CREATE TABLE `peerParticipants` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `asn` int(10) unsigned DEFAULT NULL,
  `name` varchar(256) NOT NULL,
  `aka` varchar(256) DEFAULT NULL,
  `website` varchar(128) DEFAULT NULL,
  `notes_public` text,
  `notes_private` text,
  `irr_as_set` varchar(256) DEFAULT NULL,
  `info_traffic` enum('Not Disclosed','0-20 Mbps','20-100Mbps','100-1000Mbps','1-5Gbps','5-10Gbps','10-20Gbps','20-50 Gbps','50-100 Gbps','100+ Gbps','100-200 Gbps','200-300 Gbps','300-500 Gbps','500-1000 Gbps','1 Tbps+') DEFAULT 'Not Disclosed',
  `info_ratio` enum('Not Disclosed','Heavy Outbound','Mostly Outbound','Balanced','Mostly Inbound','Heavy Inbound') DEFAULT 'Not Disclosed',
  `info_scope` enum('Not Disclosed','Regional','North America','Asia Pacific','Europe','Global') DEFAULT 'Not Disclosed',
  `info_type` enum('Not Disclosed','NSP','Content','Cable/DSL/ISP','Enterprise','Educational/Research','Non-Profit') DEFAULT 'Not Disclosed',
  `info_prefixes` int(10) unsigned DEFAULT NULL,
  `info_lookingglass` varchar(128) DEFAULT NULL,
  `info_routeserver` varchar(128) DEFAULT NULL,
  `info_unicast` char(1) DEFAULT NULL,
  `info_multicast` char(1) DEFAULT NULL,
  `info_ipv6` char(1) DEFAULT NULL,
  `policy_url` varchar(128) DEFAULT NULL,
  `policy_general` enum('Open','Selective','Restrictive','No') DEFAULT NULL,
  `policy_locations` enum('Not Required','Preferred','Required - US','Required - International') DEFAULT NULL,
  `policy_ratio` enum('Yes','No') DEFAULT NULL,
  `policy_contracts` enum('Not Required','Private Only','Required') DEFAULT NULL,
  `policy_nopublic` enum('Y','N') NOT NULL DEFAULT 'N',
  `policy_noprivate` enum('Y','N') NOT NULL DEFAULT 'N',
  `date_created` datetime DEFAULT NULL,
  `date_lastupdated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`(64)),
  UNIQUE KEY `asn` (`asn`),
  UNIQUE KEY `aka` (`aka`(64)),
  KEY `info_traffic` (`info_traffic`),
  KEY `info_ratio` (`info_ratio`),
  KEY `info_scope` (`info_scope`),
  KEY `info_type` (`info_type`),
  KEY `policy_general` (`policy_general`),
  KEY `policy_locations` (`policy_locations`),
  KEY `policy_ratio` (`policy_ratio`),
  KEY `info_unicast` (`info_unicast`,`info_multicast`,`info_ipv6`),
  KEY `policy_contracts` (`policy_contracts`),
  KEY `policy_nopublic` (`policy_nopublic`),
  KEY `date_created` (`date_created`),
  KEY `date_lastupdated` (`date_lastupdated`),
  KEY `info_prefixes` (`info_prefixes`),
  KEY `info_unicast_2` (`info_unicast`),
  KEY `info_multicast` (`info_multicast`),
  KEY `info_ipv6` (`info_ipv6`),
  KEY `info_routeserver` (`info_routeserver`),
  KEY `info_lookingglass` (`info_lookingglass`),
  KEY `irr_as_set` (`irr_as_set`)
) ENGINE=InnoDB AUTO_INCREMENT=4848 DEFAULT CHARSET=latin1;
