rk.it','Introduction\r\nActive Network is an Italian Internet Service Provider delivering broad-band accesses (xDSL), VoIP services and housing/hosting solutions to its customers.\r\n\r\nIt is registered as LIR at RIPE (it.actnet) with the 32-bit Autonomous System Number 197075 (3.467 in AS-dot notation).\r\n\r\nWe maintain and operate an IPv4 / IPv6 network and advertise the AS-ACTNET-GLOBAL as-set on all peering sessions, unless agreed upon otherwise. All the sessions are established using BGP-4 and (preferably) secured using MD5 secret.\r\n\r\nNOC contacts follow:\r\n\r\nE-Mail:	noc@activenetwork.it\r\nPhone:	+39 0761 1769199\r\nFax:	+39 06 23328079\r\n\r\n(please refer to ACT27-RIPE object for updated contacts)\r\n\r\nActive Network maintains an Open Peering Policy but expects its peers to remain in line with the following policy.\r\n\r\nDefinitions\r\n\r\nPeers		Active Network and the other party partecipating in the peering session.\r\n\r\nPeer		The party who is peering with Active Network.\r\n\r\nIn this document, the key words \"MUST\", \"MUST NOT\", \"REQUIRED\", \"SHALL\", \"SHALL NOT\", \"SHOULD\", \"SHOULD NOT\", \"RECOMMENDED\", \"NOT RECOMMENDED\", \"MAY\", and \"OPTIONAL\" are to be interpreted as described in BCP 14, RFC 2119 and indicate requirement levels for compliant peering relationship.\r\n\r\nRequirements\r\n\r\nPeers MUST advertise only their registered ASes, or ASes of their customers, and prefixes for registered routes.\r\n\r\nPeers MUST NOT advertise private and reserved addresses defined by RFC 1918 and RFC 5735 nor bogons or martians.\r\n\r\nParties MUST NOT send traffic to destinations not announced by the other party toward the other party’s network and they MUST NOT set a default route toward the other.\r\n\r\nPeers MUST NOT advertise prefixes longer than /24 (IPv4) or /48 (IPv6); longer prefixes MAY be dropped.\r\n\r\nPeers MUST accept all the valid prefixes sent by the other party.\r\n\r\nPeers MUST keep their ASes and RPSL routing policy updated.\r\n\r\nPeer MUST NOT send more than 250 prefixes and SHOULD send them fully aggregated, or MUST explain why they are not.\r\n\r\nPeer SHOULD have and maintain a complete and updated profile on PeeringDB.\r\n\r\nActive Network MAY shutdown the peering session if:\r\n\r\n-	one or more of the above requirements are not met;\r\n-	packet-loss or abnormal round-trip time delays are observed;\r\n-	abnormal traffic or activities are observed;\r\n-	the BGP session flap (dampening parameters: penalty: 1000; suppress limit: 2000; half-life: 15 minutes; reuse limit: 750; max suppress time: 1 hour; max suppress penalty: 12000).\r\n\r\nIn addition, Active Network MAY shutdown the peering session for a limited amount of time to perform maintenance on its peering routers; in such cases a notification will be send as soon as possible to the peer contacts.\r\n\r\nLegal disclaimer\r\n\r\nThe peering is based on good will and effort. Neither party is liable to the other party for losses or damage from interruption of peering for any period of time. The peering relation is unlimited in time, however Active Network reserves the right to terminate the peering at any moment without prior notice.\r\n\r\nPeering requests\r\n\r\nPlease send your peering request to peering@activenetwork.it\r\n\r\nRequests MUST contain:\r\n\r\n-	the requester\'s company name;\r\n-	complete contact information (name, phone, email);\r\n-	ASN and announced as-set name;\r\n-	the desired site of peering.',NULL,'AS-ACTNET-GLOBAL','Not Disclosed','Mostly Inbound','Regional','Cable/DSL/ISP',10,NULL,NULL,'1',NULL,'1',NULL,'Open','Not Required','No','Not Required','N','N','2011-01-20 14:17:30','2011-05-13 15:30:43'),(3719,16397,'Alog Data Centers do Brasil',NULL,'http://www.alog.com.br',NULL,NULL,NULL,'5-10Gbps','Mostly Outbound','Regional','NSP',350,'http://lg.alog.com.br',NULL,'1',NULL,'1',NULL,'Open','Not Required','No','Not Required','N','N','2011-01-20 15:06:12','2011-06-21 12:23:52'),(3720,55915,'Cl